import React from 'react';
import Navbar_left from './base/navbar_left';
import Home from './home/home';
import Home_serch from './home/home_serch';

const Contents = (props) =>{

    const router = () => {
        switch (props.path) {
            case '/home':
                return (
                     <Home/>
            )

            default:
                break;
        }
    }
    return(
        <>

            {
                router()
            }
        </>
    )
};

export default Contents;
